import Nav from "./Home/Nav";
import { useState } from "react";

function  SingUp(){
   const [username,setusername] =useState('');
   const [email,setemail] =useState('');
   const [password,setpass] =useState('');

    return(
        <div>
            <Nav></Nav>

            <div className="singupContainer">
                welcome to singup page
                  <label htmlFor="email">Email</label>
                   <input type="email" id="email"/>
                   <br/>
                   <label htmlFor="username">USERNAME</label>
                   <input type="text" value={username} onChange={(e)=>{setusername(e.target.value)}}id="username"/>
                   <br />
                   <label htmlFor="password">SET-Password</label>
                   <input type="text" id="password" />
                   <br />
                   <label htmlFor="ph-number">Ph.No.</label>
                   <input type="text" id="phnumber" />
                   <br />
                   <label htmlFor="hostel-no">Hostel NO.</label>
                   <input type="number" id="hostel-no"  min="1" max="13"/>
                   <br />

                   <button id="login">SingUp</button>
                   <br />
            </div>
          
        </div>
    );
}
export default SingUp;
